import React, { useState, useEffect } from 'react';
import VisibilityIcon from '@material-ui/icons/Visibility';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';
import IconButton from '@material-ui/core/IconButton';  
import axios from 'axios';

const ManageUsers = () => {

   const {users, setUsers} = useState([]);
  
   useEffect(() => {

    loadUsers();

   },[])
   
   const loadUsers = async () => {
     const response = await axios.get('http://localhost:5000/users_list/');
     console.log(response.data)
     

   }


    return(
        <>
        <div className="container mt-5 vh-100">
            <div className="row">
                <div className="col-md-12 mt-5">
                <table class="table table-bordered">
  <thead className="thead-light ">
    <tr>
      <th scope="col">S.No.</th>
      <th scope="col">Name</th>
      <th scope="col">User Name</th>
      <th scope="col">Email ID</th>
      <th scope="col">Action</th>
    </tr>
  </thead>
  <tbody>
    <tr>

      <th className="align-middle" scope="row">1</th>
      <td className="align-middle">Sandeep Kumar</td>
      <td className="align-middle">Sandeep</td>
      <td className="align-middle">sandeep.k9953@gmail.com</td>
      <td className="align-middle">
    
      <IconButton aria-label="view" variant="outlined" className="MuiIconButton-colorLast" >
      <VisibilityIcon/>
     </IconButton>

     <IconButton aria-label="edit" color="primary">
      <EditIcon />
     </IconButton>

     <IconButton aria-label="delete" color="secondary">
      <DeleteIcon />
     </IconButton>

      </td>
    </tr>
  </tbody>
</table>

                </div>
            </div>
        </div>
        </>
    )
}

export default ManageUsers;
